# need to see if the values are multiple of all others
def hasGroupsSizeX(deck):
    def gcd(x, y):
        while y != 0:
            (x, y) = (y, x % y)
        return x

    dic={}
    for i in deck:
        dic[i] = dic.get(i,0)+1




    val = list(dic.values())
    print(val)
    res = val[0]
    for c in val[1::]:
        res = gcd(res,c)
    return res>=2

